import React, { useEffect, useState } from "react";

const headerStyle = {
  border: "1px solid black",
  padding: "8px",
  textAlign: "left",
  backgroundColor: "#f2f2f2",
};
const cellStyle = {
  border: "1px solid black",
  padding: "8px",
  textAlign: "left",
};
export default function MusicInsights() {
  const [danceabilityData, setDanceabilityData] = useState([]);
  const [loudnessData, setLoudnessData] = useState([]);
  const [audioProfilesData, setAudioProfilesData] = useState([]);

  console.log("Danceability Data:", danceabilityData);
console.log("Loudness Data:", loudnessData);
console.log("Audio Profiles Data:", audioProfilesData);
  // Fetch Tracks with Above-Average Danceability
  useEffect(() => {
    fetch("http://localhost:8080/aboveAverageDanceability")
      .then((res) => res.json())
      .then((data) => setDanceabilityData(data.rows || []))
      .catch((error) => console.error("Error fetching danceability data:", error));
  }, []);

  // Fetch Rank Tracks by Loudness
  useEffect(() => {
    fetch("http://localhost:8080/rankTracksByLoudness")
      .then((res) => res.json())
      .then((data) => setLoudnessData(data.rows || []))
      .catch((error) => console.error("Error fetching loudness data:", error));
  }, []);

  // Fetch Top Audio Profiles by Genre
  useEffect(() => {
    fetch("http://localhost:8080/topAudioProfiles")
      .then((res) => res.json())
      .then((data) => setAudioProfilesData(data.rows || []))
      .catch((error) => console.error("Error fetching audio profiles data:", error));
  }, []);

  return (
    <div style={{ maxWidth: "1000px", margin: "0 auto", padding: "20px" }}>
      <h1>Music Insights</h1>

      {/* Feature 1: Tracks with Above-Average Danceability */}
      <section style={{ marginBottom: "40px" }}>
        <h2>Tracks with Above-Average Danceability</h2>
        <table style={{ width: "100%", borderCollapse: "collapse" }}>
          <thead>
            <tr>
              <th style={headerStyle}>Track Title</th>
              <th style={headerStyle}>Genre</th>
              <th style={headerStyle}>Danceability</th>
            </tr>
          </thead>
          <tbody>
            {danceabilityData.map((row, idx) => (
              <tr key={idx}>
                <td style={cellStyle}>{row.title}</td>
                <td style={cellStyle}>{row.genre_name}</td>
                <td style={cellStyle}>{row.danceability}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </section>

      {/* Feature 2: Rank Tracks by Loudness */}
      <section style={{ marginBottom: "40px" }}>
        <h2>Rank Tracks by Loudness</h2>
        <table style={{ width: "100%", borderCollapse: "collapse" }}>
          <thead>
            <tr>
              <th style={headerStyle}>Rank</th>
              <th style={headerStyle}>Track Title</th>
              <th style={headerStyle}>Genre</th>
              <th style={headerStyle}>Loudness (dB)</th>
            </tr>
          </thead>
          <tbody>
            {loudnessData.map((row, idx) => (
              <tr key={idx}>
                <td style={cellStyle}>{row.loudness_rank}</td>
                <td style={cellStyle}>{row.title}</td>
                <td style={cellStyle}>{row.genre_name}</td>
                <td style={cellStyle}>{row.loudness}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </section>

      {/* Feature 3: Top Audio Profiles by Genre */}
      <section>
        <h2>Top Audio Profiles by Genre</h2>
        <table style={{ width: "100%", borderCollapse: "collapse" }}>
          <thead>
            <tr>
              <th style={headerStyle}>Genre</th>
              <th style={headerStyle}>Valence</th>
              <th style={headerStyle}>Energy</th>
              <th style={headerStyle}>Danceability</th>
              <th style={headerStyle}>Profile Count</th>
            </tr>
          </thead>
          <tbody>
            {audioProfilesData.map((row, idx) => (
              <tr key={idx}>
                <td style={cellStyle}>{row.genre_name}</td>
                <td style={cellStyle}>{row.valence}</td>
                <td style={cellStyle}>{row.energy}</td>
                <td style={cellStyle}>{row.danceability}</td>
                <td style={cellStyle}>{row.profile_count}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </section>
    </div>
  );




  return (
    <div>

      {/* Navigation Bar */}
      {/* 不要动 */}
      <div id="navbar">
        <ul>
          <li><a href="http://localhost:3000/">HomePage</a></li>
          <li><a href="http://localhost:3000/search">Search Page</a></li>
          <li><a href="http://localhost:3000/genre">Genre Page</a></li>
          <li><a href="http://localhost:3000/collaboration">Collaboration</a></li>
        </ul>
      </div>

    </div>
  );
}
